import { ProductConsumer } from "../context";


export default class Cart extends Component {
    render() {
        return (
            <div className='container'>
                <div className='row'>
                    <ProductConsumer>
                        {value => {
                            const {title, img, price, total} =value.cart
                        }

                        }
                    </ProductConsumer>
                    
                </div>             
            </div>
        )
    }
}
